import React from "react";
import "./Home.css";
import { Menu } from "antd";

function Home() {
  return (
    <div>
      <Menu>
        items={[
           {label: "Home" },
          {  label: "DashBoard" },
          { key: "users", label: "Users list" },
        ]}

      </Menu>
      <div>Content</div>
    </div>
  );
}
function Content() {
  return (
    <div className="home-container"></div>
  );
}
export default Home;
